        ('94bce49e1f03', '1', 0, null, '2022-02-04 22:17:30', '2023-06-24 21:41:37', '5015df0b6259', 'b0c58f2d5c48', '318e064ea0c9', 'singletext', '{"html": "<p>Wir stÃ¼rzen ab. Der Pilot verlÃ¤sst das Flugzeug frÃ¼her, weil die Steuerung nicht mehr funktioniert und er der Meinung ist, dass wir in die Insel stÃ¼rzen wÃ¼rden und er nicht sterben will. oder so Ã¤hnlch de Pilot isch denn eifach verscholle</p>"}'),
