        ('764477318be2', '1', 1, null, '2022-02-04 19:40:24', '2023-06-24 21:53:15', 'c6eb39db9f9c', 'c6eb39db9f9c', 'cfccaecd4bad', 'storyboard', '{"sections": {"d528c7b4-5655-497f-bca0-fd9a0dc4a490": {"column1": "''00 - ''15", "column3": "Farfalla", "position": 0, "column2Html": "<p>Als Ãbergang zum TABS erklÃ¤rt Farfalla was das Pafdivereprechen ist und wie es in Zusammenhang mit den Pfadigesetzen steht. Dann werden die TN darauf hingewiesen, dass sie im Lager die MÃ¶glichkeit haben werden das Versprechen abzulegen (jÃ¼ngere TN Vorversprechen) und sie sich Gedanken machen sollen, ob sie dies tun wollen oder nicht. Bei Fragen sollen sie sich bei Farfalla melden.</p>"}, "fb42521c-27a9-482e-9be2-b696a5447ffb": {"column1": "''15 - ''30", "column3": "", "position": 1, "column2Html": "<p>Wir singen im Kreis ein Bajuschki-Baju und der Ta-Che schliesst den Tag ab (kann selbst entscheiden wie, sicher den TN sagen ab wann Nachtruhe, wie viel Zeit sie zum ZÃ¤hneputzen etc. haben)</p>"}}}'),
        ('7fb4b671a287', '1', 0, null, '2022-02-04 22:22:15', '2022-02-04 22:22:15', '7792c9c855ce', '60dad45d3561', 'cfccaecd4bad', 'storyboard', '{"sections": {"0f270214-029b-4889-9367-3d687e571eba": {"column1": "", "column3": "", "position": 2, "column2Html": "<p>Was giebt es besseres als zu Snacken beim Warten. Wir erklÃ¤ren den Kindern wie man Brennesselchips macht.</p><p>1. Die Brennnesseln am besten mit Handschuhen schneiden und die BlÃ¤tter abpflÃ¼cken</p><p>2. BlÃ¤tter waschen und in Salatschleuder trocknen. Sobald die Brennnesseln gewaschen sind, brennen sie nicht mehr!</p><p>3. Kokosfett oder RapsÃ¶l in der Pfanne heiss werden lassen, die BrennnesselblÃ¤tter beifÃ¼gen und mit der Kelle vorsichtig wenden</p><p>5. Wenn die BlÃ¤tter knusprig sind, auf KÃ¼chenpapier abtropfen lassen</p><p>6. Mit Salz, Curry oder anderen GewÃ¼rzen bestreuen und sofort geniessen</p>"}, "878cf4ac-3715-4320-8e83-74f5c271197a": {"column1": "", "column3": "", "position": 4, "column2Html": "<p>Nach einer Weile spielen wir ein Paar spiele um uns wieder etwas zu bewegen.</p><p>Amerikanische Buldoggen</p><p>Schreimauer. Es giebt einen Sender und einen EmpfÃ¤nger. Der Sender muss dem EmpfÃ¤nger eine Nachricht schreien. Die restlichen personen mÃ¼ssen das verhindern indem sie eine LÃ¤rmwand machen zwischen dem Sender und dem EmpfÃ¤nger und in dei Reichtung des Senders schreien.</p>"}, "95124339-4b73-4168-8d87-b308fe39dc7e": {"column1": "", "column3": "", "position": 1, "column2Html": "<p>Diverse Bastelspass mit Blubb</p><p>Wir knÃ¼pfen BÃ¤ndeli auf spezielle Art (BeispielbÃ¤ndeli von Blubb)</p><p>Wir lernen wie man einen Kranich faltet. (Bei 1000 Kranich hat man einen Wunsch frei. Wir kÃ¶nnten uns wÃ¼nschen, dass wir gerettet werden)</p><p>How to make a Hexaflexagon.</p>"}, "9b6b4294-77df-4245-ab89-d83c43e89fa1": {"column1": "", "column3": "", "position": 3, "column2Html": "<p>FÃ¼r diejenigen die doch noch ewas sinnvolles machen wollen zeigen wir ihnen wie man ZundhÃ¶lzli wasserdicht macht. Dazu schmilzt man etwas wachs und legt sie im Wachs ein sodass eine Schicht Wachs um das Streichholz entsteht. Dasselbe macht man nun mit dem AnzÃ¼ndstreifen und Voila Wasserdicht.</p><p>Flaschenpost.</p><p>Die Kinder dÃ¼rfen frei eine Nachricht entwerfen die wir in eine Flaschenpost tun. Diese Flaschenpost werden wir dann in irgend einer Ãbung in einem Halben Jahr wiederfinden.</p><p>Ausserdem kann man ein paar ZundhÃ¶lzlirÃ¤tsel machen: </p><p>Aus sechs StreichhÃ¶lzern 4 gleich grosse Dreiecke machen</p><p>Aus 4 StreichhÃ¶lzern 5 Rechtecke machen</p><p>Die mÃ¼nze aus der Schaufel nehmen</p>"}, "c4d2d08a-ae82-4316-83f3-b550f09d553e": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Wir besammeln uns im Aufenthaltszelt und besprechen was wir machen kÃ¶nnten. Die Leiter disskutieren Laut ob wir eventuell ein Notsignalfeuer machen kÃ¶nnten. Andere meinen wir kÃ¶nnten mit steinen einen Hilferuf schreiben, damit man diesen aus der Luft sehen wÃ¼rde. Blubb ist der Meinung, dass wir warten sollten bis hilfe kommt und uns etwas die Zeit vertreiben sollten. wir machen Posten an denen man verschiedene Sachen lernen kann.</p>"}}}'),
        ('94448eaafa0d', '1', 0, null, '2022-02-04 22:20:19', '2022-02-04 22:20:19', 'f9ba3a735450', 'c20a38fbe5bd', 'cfccaecd4bad', 'storyboard', '{"sections": {"0b14a6e1-461d-4589-947f-d427bb9198d8": {"column1": "02:00", "column3": "", "position": 5, "column2Html": "<p>Ende</p>"}, "b375ec19-ab8b-4fcb-afca-4c0163fc1b72": {"column1": "00:00", "column3": "", "position": 0, "column2Html": "<p>Die TN sitzen mit Ikarus gemÃ¼tlich im Aufenthaltszelt, als plÃ¶tzlich die KÃ¼che schreit: Alarm Alarm. Wir rennen sofort zur KÃ¼che und sehen noch einen Eingeborenen (Tassilo) mit einem Leib Brot davon rennen. Wir nehmen natÃ¼rlich sofort die Verfolgung auf und rennen ihm hinterher. Er rennt zu einer Gruppe Eingeborenen mit einem HÃ¤uptling (Blubb) und diese bleiben stehen. Sie sind so viele, dass wir nicht direkt angreifen. Wir schreien ihn an, dass er sofort das Brot zurÃ¼ck geben muss. Der HÃ¤uptling findet, das ist sein Land und wir sollten sofort verschwinden. Wir sagen wir hatten einen Flugzeugabsturz und warten auf Hilfe und kÃ¶nnen nicht weg, da wir nicht wissen, wohin. Der HÃ¤uptling hÃ¤lt uns aber fÃ¼r bÃ¶se DÃ¤monen, die er vernichten muss, wir werden nie ruhig schlafen und essen auf seinem Land, bis wir weg sind. Dann verschwinden die Eingeborenen im Wald, und das Game beginnt.</p>"}, "c64fd9c1-1717-4a7c-8ba9-fbf6f7508c73": {"column1": "01:50", "column3": "", "position": 4, "column2Html": "<p>Alles Essen wurde leider geklaut, Spielende. Wir gehen zurÃ¼ck zum Lagerplatz</p>"}, "cc9d6339-d2a6-4480-98db-c16ec69c118f": {"column1": "00:30", "column3": "", "position": 3, "column2Html": "<p>Alle Gruppen haben BÃ¤ndli angebunden und den Gruppenplatz bestimmt, Spielstart</p>"}, "d6677cd8-35c5-4880-badf-816a13278382": {"column1": "00:10", "column3": "", "position": 1, "column2Html": "<p>SpielerklÃ¤rung (Ikarus):</p><p>Auf einem Spielfeld ist das Lager eingezeichnet, und 3 verschiedene Wege, die zu 3 verschiedenen Lagern fÃ¼hren. Auf jedem Weg ist ein Eingeborener, der das Essen aus dem Lager klauen will. Bei jedem Lager sind 5 Essen, die geklaut werden kÃ¶nnen, wenn eine Gruppe kein Essen mehr hat, hat sie verloren. Jedes mal, wenn ein Eingeborener es bis ins Lager geschafft hat, ist ein Essen weg. Jede Viertelstunde kann ein TN pro Gruppe zum neutralen Posten kommen, und mit BÃ¤ndeli WÃ¼rfelwÃ¼rfe kaufen. Mit jedem WÃ¼rfelwurf kann man einen Eingeborenen bewegen, es ist aber egal, welchen. Wenn man aber den Eingeborenen auf einem anderen Weg nÃ¤her an deren Lager fÃ¼hrt, dann werden die Eingeborenen natÃ¼rlich diesen weiter bewegen, da dieser eher Essen klauen wird.</p><p>Die Eingeborenen sind natÃ¼rlich auch eine Gruppe, die versucht, mÃ¶glichst viel Essen zu klauen, und auch mit BÃ¤ndeli WÃ¼rfelwÃ¼rfe kauft, die sie jede Viertelstunde eintauscht. Jede Gruppe hat an einem Gruppenplatz einen KnÃ¤uel mit der eigenen BÃ¤ndelifarbe.</p><p>Sobald der Eingeborene das Essen gelaut hat, ist er wieder auf dem Startfeld</p><p>Neutraler Posten: Ikarus</p><p>Eingeborene: Tassilo, Blinky, Jiminy, Swuppi, Zera, Blubb</p>"}, "e739f40e-3812-45a0-b29d-e15d4915751e": {"column1": "00:20", "column3": "", "position": 2, "column2Html": "<p>Jede Gruppe sucht sich einen Gruppenplatz und bindet sich das BÃ¤ndli an.</p>"}}}'),
        ('f81e2d53f972', '1', 1, null, '2022-02-04 19:35:38', '2023-06-24 21:48:04', 'a2505e2c8aca', 'a2505e2c8aca', 'cfccaecd4bad', 'storyboard', '{"sections": {"46b2cef1-e0c0-4806-95cd-fcc5ae28f394": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Die TN erledigen in ihren 4 Ãmtligruppen die Ãmtli:</p><p>- Abwaschen</p><p>- Holzen</p><p>- Joker (+ immer einmal pro Tag Lagertagebuch)</p><p>- Wasser auffÃ¼llen</p><p>Ein Leiter bleibt bei den TN wÃ¤hrenddem die anderen hÃ¶cken (nicht der Ta-Che) und \"Ã¼berwacht\" die Ãmtli: gibt Material fÃ¼rs Holzen heraus (je nach Alter TN und FÃ¤higkeit), schaut dass das Abwaschen speditiv lÃ¤uft (Abwaschwasser gekocht etc.)</p><p>Sind die TN fertig mit ihren Ãmtlis (von Leiter abgenommen und bestÃ¤tigt) haben sie Siesta --&gt; Freizeit: Sie kÃ¶nnen die VoilÃ  Freizeitangebote nutzen, die Leiter kÃ¶nnen nach ihrem HÃ¶ck Spiele anbieten (wenn Zeit &amp; Lust) z.B. Volleyball. In dieser Zeit brieft der Ta-Che den Leiter, der nicht am HÃ¶ck dabei war.</p>"}}}'),
        ('d085827cc306', '1', 2, null, '2023-08-12 17:41:55', '2023-08-12 17:41:55', '27e64b35f155', '27e64b35f155', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 9}, {"slot": "2", "width": 3}]}'),
        ('dc75baaba771', null, 0, null, '2023-08-12 17:41:55', '2023-08-12 17:41:55', 'dc75baaba771', null, 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 12}]}'),
        ('847374e5e4bf', '1', 0, null, '2022-02-04 22:21:03', '2022-02-04 22:21:03', '280031715953', 'd5cd5fd59e4a', 'cfccaecd4bad', 'storyboard', '{"sections": {"1a484263-02b6-48b6-911e-75535f15e53e": {"column1": "0.00", "column3": "", "position": 0, "column2Html": "<p>Wir schreiben gemeinsam das  Pfadiversprechen und das Pfadigesetz auf (TN''s sollen sagen was sie schon wissen, wir ergÃ¤nzen): </p><p>Versprechen:</p><p>Ich verspreche, mein mÃ¶glichstes zu tun, um </p><p>mich immer von neuem mit dem Pfadigesetz auseinanderzusetzen</p><p>nach Sinn und Ziel meines Lebens zu suchen</p><p>mich in jeder Gemeinschaft einzusetzen, in der ich lebe</p><p>(Im Vertrauen auf Gott und) Zusammen mit Euch allen versuche ich, nach diesem Versprechen zu leben. </p><p>Gesetz:</p><p>Wir Pfadi wollen...</p><p>...offen und ehrlich sein</p><p>...Freude suchen und weitergeben</p><p>...unsere Hilfe anbieten</p><p>...uns entscheiden und Verantwortung tragen</p><p>...andere verstehen und achten</p><p>...miteinander teilen</p><p>...Sorge tragen zur Natur und allem Leben</p><p>...Schwierigkeiten mit Zuversicht begegnen</p>"}, "5f14e827-d5d2-496b-9caa-dedc92fea8e7": {"column1": "0.20", "column3": "", "position": 1, "column2Html": "<p>Es werden 3er Gruppen gebildet, jede Gruppe bekommt ein Couvert. Im Couvert finden sie, die SÃ¤tze des Pfadigesetze sin StÃ¼cke geschnitten. Ziel ist es zu dritt das Pfadigesetz wieder zusammen zu setzen z.B. auf einer Blache vor dem Aufenthaltszelt SÃ¤tze zusammen kleben</p><p>Sobald das Pfadigesetz zusammen gesetzt ist, sollen sich die Gruppe den wichtigsten Satz aus dem Gesetz heraussuchen.</p>"}, "9da4ef60-8a0d-4583-9cec-cb39b8b0a6ba": {"column1": "0.50", "column3": "", "position": 2, "column2Html": "<p>Anschliessend treffen sich alle wieder im Aufenthaltszelt und jede Gruppe stellt den fÃ¼r sie wichtigsten Satz aus dem Pfadigesetz vor und es wird diskutiert warum dies sein kann oder nicht.</p>"}, "b518ca3b-72f3-4afe-90ea-f2db5d10215a": {"column1": "1.20", "column3": "", "position": 3, "column2Html": "<p>Nach der Diskussion bleibt Zeit zu 2. oder zu 3. das Pfadiversprechen zu reptieren und zu lernen wer will kann Stift und Papiere haben oder es den Leitern vorsagen</p>"}, "c6ae8444-e0a5-4561-869e-56ee5878053e": {"column1": "1.50", "column3": "", "position": 4, "column2Html": "<p>Wir treffen uns nochmals im Aufenthaltszelt um Fragen zu klÃ¤ren. Wir versuchen nochmals alle Teile des Pfadiversprechens und Pfadigesetzt zusammen zu bringen (mÃ¼ndlich)</p>"}}}'),
        ('9e69a2d0f217', '1', 2, 'Schlechtwetterprogramm', '2022-02-04 21:14:27', '2023-06-24 21:48:54', 'a71f929dd156', 'a71f929dd156', 'cfccaecd4bad', 'storyboard', '{"sections": {"3e80526d-f6eb-415f-aa66-c4d14c80d83a": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Zelte mÃ¼ssen trotzdem aufgebaut werden.</p><p>Zvieri bei Unterstand</p>"}}}'),
