        ('d0d0bef87638', null, 0, 'est', '2022-02-04 21:59:10', '2022-02-04 21:59:10', 'd0d0bef87638', null, 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 12}]}'),
        ('985356416a4b', null, 0, 'est', '2022-02-04 22:06:20', '2022-02-04 22:06:20', '985356416a4b', null, 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 12}]}'),
        ('37616c74811f', null, 0, 'est', '2022-02-04 22:10:06', '2022-02-04 22:10:06', '37616c74811f', null, 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 12}]}'),
        ('283a58df7d9b', '1', 0, null, '2022-02-04 19:37:23', '2023-06-24 21:49:52', 'd62d16c6afb6', '5bbb40c7bb0f', '318e064ea0c9', 'singletext', '{"html": "<p>Die Teilnehmer erreichen Das Hogwarts-Sommercamp und erfahren dessen wahre Bedeutung - wir wollen Harry''s Horkruxe zerstÃ¶ren und ihn so wieder zu dem liebenswerten Zauberer machen, den wir alle kennen und lieben. Denn seit dem Ende der Buchserie ist einige Zeit vergangen und Harry ist der Erfolg zu Kopf gestiegen. SÃ¼chtig nach Macht hat auch er, wahrscheinlich durch die hinterlassenen Spuren des Daseins als Voldemort''s Horkrux, sieben Horkruxe erschaffen. Unsere Aufgabe ist es nun, diese zu finden und zu zerstÃ¶ren, so dass Harry''s Seele wieder ganz wird. Da wir offiziell aber natÃ¼rlich das Image des Hogwarts-Sommercamps aufrecht erhalten mÃ¼ssen, werden die Teilnehmer in vier HÃ¤user aufgeteilt (20 TN --&gt; 4 Gruppen Ã  5). Dies sind die Zeltgruppen und in ihnen kÃ¶nnen die TN Punkte fÃ¼r ihre HÃ¤user sammeln indem sie z.B. das erste komplett anwesende Zelt sind wenn es pfeift etc. Die Hogwarts-HÃ¤user competition wird also auch in unserem \"Sommercamp\" weitergefÃ¼hrt. Leiter des Camps is Albus Potter, Harry''s Sohn.</p><p>Die Figuren stellen sich vor: Hauslehrer</p><p>Farfalla: Gryffindor</p><p>Castor: Slytherin</p><p>Biber: Ravenclaw</p><p>Salamander: Hufflepuff</p><p>Adler: Filch</p><p>Pandora: Irgende WEasly</p><p>Weiter mÃ¶gliche Personen:</p><p>Albus Potter, Ted Lupin, Rose oder Hugo Weasly, Scorpius Malfoy, Swagrid</p><p>Allgemeine Dinge Ã¼ber das Harry Potter universum werden erzÃ¤hlt:</p><p>- hÃ¤user, Hogwarts, verbotener wald, zaubersprÃ¼che, das ministerium, spezielle wesen wie zentauren phÃ¶nix etc., denkarium..?</p>"}'),
        ('1a74a1186c21', '1', 0, null, '2023-06-24 21:35:25', '2023-06-24 21:35:55', '8fa1c8e597c3', '8fa1c8e597c3', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 4}, {"slot": "2", "width": 5}, {"slot": "3", "width": 3}]}'),
        ('86f38eb0029e', '1', 1, null, '2022-02-04 19:39:09', '2023-06-24 21:51:40', '83b61af97910', '83b61af97910', 'cfccaecd4bad', 'storyboard', '{"sections": {"3959cbfe-56b2-4e99-9a41-e8979434fc4d": {"column1": "00:00", "column3": "Castor", "position": 0, "column2Html": "<p>ErklÃ¤rung des Ablaufs (verschiedene Phasen)</p><p>ErklÃ¤rung der Special-Hogwarts-Features</p><p>Vorlesen der einzelnen Charakteren.</p><p>ausgedruckte Liste mit Charakteren aufhÃ¤ngen!</p>"}}}'),
        ('e7d30e274563', '1', 0, null, '2022-02-04 22:19:53', '2022-02-04 22:19:53', '8e15971caab8', 'ed784a290de3', 'cfccaecd4bad', 'storyboard', '{"sections": {"2f0a0b2b-e808-40b9-8d19-245467a4aea7": {"column1": "0015", "column3": "", "position": 1, "column2Html": "<p>Um unseren oreinteierungssinn zu schÃ¤rfen wird in einem definierten Feld ein gegenstand geworfen den man mit glocken hÃ¶rt. Nun kÃ¶nnen die Teilnehmer (sie haben sich die Augen verbunden) mithilfe ihres gehÃ¶rssinnes versuchen diesen gegenstand zu finden. Dieses Spiel wird mehrmals wiederholt bis wir unsere Sinne geschÃ¤rft haben.</p>"}, "6a93f23c-5fb5-4924-a407-0d7c822be890": {"column1": "0130", "column3": "", "position": 2, "column2Html": "<p>Zum abschluss spielen wir ein Schoggispiel. Dabei muss sich eine Person winterhandschuhe und diverse utensilien anziehen und darf dann beginnen mit Messer und Gabel eine in in Zeitund eingepackte Schokoladentafel zu essen. Die anderen versuchen mit WÃ¼rfeln eine 6 zu wÃ¼rfeln. wenn ihnen das gelingt muss die essende Person alle utensilien ablegen und die neue Person muss sie anlegen und darf versuchen die schokolade zu essen. vor jedem wÃ¼rfeln muss man einen Hampelmann machen.</p>"}, "de24f984-3105-4bda-8021-393139f7e076": {"column1": "0115", "column3": "", "position": 0, "column2Html": "<p>Wir machein einen OL bei dem Jede gruppe zuerst einen Teil der Karte bekommt. nun ist ein Punkt auf einem SichtmÃ¤pli eingezeichnet an dem der Posten sein muss. Sie mÃ¼ssen nun entweder abschÃ¤tzen wo der neue Kartenteil sein kÃ¶nnte oder mit den anderen Gruppen zusammenarbeiten um dei Posten zu finden.</p>"}}}'),
        ('d7c126cfce5e', null, 0, null, '2023-08-12 17:41:55', '2023-08-12 17:41:55', 'd7c126cfce5e', null, 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 12}]}'),
        ('a40fe86d1955', '1', 2, null, '2023-08-12 17:41:55', '2023-08-12 17:41:55', 'd7c126cfce5e', 'd7c126cfce5e', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 9}, {"slot": "2", "width": 3}]}'),
        ('4cbbb7c9e91c', '1', 1, null, '2023-08-12 17:50:05', '2023-08-12 17:50:05', '0f50c26e1edb', '0f50c26e1edb', '318e064ea0c9', 'singletext', '{"html": ""}'),
        ('8e2119b66e8f', '1', 0, null, '2022-02-04 22:24:04', '2022-02-04 22:24:04', 'd81a9dae4316', '945b99f32295', 'cfccaecd4bad', 'storyboard', '{"sections": {"1b011ba0-3d74-4f5d-af48-23e9f41b3935": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Wir Treffen uns vor der KÃ¼che und alle Kinder werfen ihren Anonymen Brief in denn Pfaditopf. Danach wird nachmals der ganze Ablauf erklÃ¤rt. </p><p>1. Still zum Bi-Pi Feuer laufen.</p><p>2. Feuer anzÃ¼nden</p><p>3. Brief</p><p>4. Abteilungslied singen</p><p>5. Private Zettel vorlessen</p>"}, "a6533cc3-ff37-4d9f-b9db-3016c0a8ec3f": {"column1": "", "column3": "", "position": 1, "column2Html": "<p>Zusammen Laufen wir zum Bi-Pi Feuer und geniessen unser Ritual.</p><p>1. Der Feuermeister macht Feuer</p><p>2. Zera liest den Letzten Brief von Bi-Pi vor</p><p>3. Wir Singen das Abteilungslied</p><p>4. Wir geben denn Kessel durch und jeder zieht einen Zettel der er vorliest</p>"}, "b9e5b5ac-6a1d-4756-800c-e18bb3b7858c": {"column1": "", "column3": "", "position": 2, "column2Html": "<p>laufen die Kinder (vereinzelt) zurÃ¼ck zum Lagerplatz wenn sie alles Ã¼berdenkt haben.</p><p> Danach gibt es das Lagerfeuer-feeling in der KÃ¼che mit Schoggi-Bananen und Marshmallows.</p>"}}}'),
        ('ac207e1f00cb', '1', 0, null, '2022-02-04 22:27:21', '2022-02-04 22:27:21', '13d74b9d52b8', '09b019b76b75', 'cfccaecd4bad', 'storyboard', '{"sections": {"4ae2e2c4-a675-4677-b758-52d7b7d8f9c5": {"column1": "", "column3": "", "position": 2, "column2Html": "<p>Beim Aufenthaltszelt wird den Kindern erklÃ¤rt was eine A Blache und was eine B Blache ist. Nun mÃ¼ssen die Kinder die A Blachen von den B Blachen trennen und ein Leiter demonstriert ihnen wie man eine Reepschnur korrekt einfÃ¤delt. Die Kinder machen das nach und fassen die Blachen in 10erhÃ¤ufen zusammen.  Am schluss machen sie zuerst gemeinsam mit einem Leiter und dann alleine BlachenbÃ¼nde.</p>"}, "8c514b4d-22e8-4eb4-a786-d39210d90211": {"column1": "", "column3": "", "position": 1, "column2Html": "<p>Bei den Schlafzelten zeigen die Leiter den Teilnehmern wie sie ein Spatz korrekt abbauen und reinigen. Die Kinder machen das nach.</p>"}, "c6d5f878-f523-47c7-8706-e1f5d69c1124": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Wir bilden Gruppen in denen wir die einzelnen Lagerbauten wieder korrekt versorgen.</p><p>Gruppe eins: Schlafzelte</p><p>Gruppe zwei: Aufenthaltszelt + Latrine</p>"}}}'),
        ('bbc4c3603119', '1', 0, null, '2022-02-04 22:24:36', '2022-02-04 22:24:36', 'e460f03e79b4', 'e69cb9c4d43c', 'cfccaecd4bad', 'storyboard', '{"sections": {"206ac116-1262-444c-9f59-9682e42f8ff9": {"column1": "00.05", "column3": "", "position": 0, "column2Html": "<p>Aufwecken mit Musik</p>"}, "2e13bd7e-cd50-445e-8c96-29941416fc00": {"column1": "00.30", "column3": "", "position": 2, "column2Html": "<p>Gordischer Knoten :Einer geht 1 minute weg und die restlichen Personen mÃ¼ssen sich so gut wies geht verknoten das ziel ist das die eine person den knoten wieder aufmacht. ÃSSÃÃÃÃÃ</p>"}, "9ba6a3b0-201b-4f75-a5b5-9e483d7bdae5": {"column1": "00.20", "column3": "", "position": 1, "column2Html": "<p>TriffdendÃ¶del: Alle stehen in einem Kreis und man wirft eine mit WassergefÃ¼llten Pet Flasche einer Person zu und die Person mus die Flasche einhÃ¤ndig fangen wenn er sie nicht fÃ¤ngt mus er um den kreis rennen und man kann ihn abwerfen er muss solang er getroffen wird rundenen rennen bis er es ihn seine lÃ¼cke schafft.</p>"}}}'),
        ('3127de277825', '1', 0, null, '2022-02-04 22:21:35', '2022-02-04 22:21:35', 'd4fe28437432', 'a046328425df', 'cfccaecd4bad', 'storyboard', '{"sections": {"2db45c1d-1e89-4158-9446-507d04f49410": {"column1": "00.00", "column3": "", "position": 0, "column2Html": "<p>Wir finden eine essens-, federspur und folgen dieser, weil das ja sciher die aboriginis waren</p>"}, "447f6da8-8a92-4d46-bf16-15122af9e9eb": {"column1": "00.15", "column3": "", "position": 1, "column2Html": "<p>Wir finden das Aboriginis versteck, jedoch bewachen sie ihren Vorrat und wir Ã¼berlegen uns wie wir sie ablenken kÃ¶nnen. (Sackmesser, Taschenlampen, musik, einfach neue dinge, die sie nicht kennen)</p>"}, "5461cc5a-9e82-4316-878d-089da74030d0": {"column1": "00.20", "column3": "", "position": 2, "column2Html": "<p>Auf ihrem Vorrat (ein loch) hat es aufgeblasene Ballone und essensreste (schweine magen, also weisse ballone), die wir zuerst verplatzen mÃ¼ssen. ein teil der Kinder lenkt die Aboriginis ab (ohne berÃ¼hren) und die andern mÃ¼ssen die Ballone verplatzen gehen und haben drei leere Ballone dabei. Doch bei jedem platzen, rennt ein aborgini los und versucht den TN zu catchen, wenn ers geschafft hat muss der Tn ihm ein Ballon abgeben. Die TNs mÃ¼ssen hinter eine sicherheits linie rennen und dort sind sie dann safe. FÃ¼r neue Ballone mÃ¼ssen die Tns fragen beantworten oder Aufgaben machen. Ziel ist, dass alle ballone im Vorrat geplatzt sind und wir unser essen zurÃ¼ck holen kÃ¶nnen.</p>"}, "67e942b4-a254-4423-a95a-85311e45d532": {"column1": "1.10", "column3": "", "position": 3, "column2Html": "<p>Die Aboriginis sind geschlagen, wir haben unser essen wieder und laufen glÃ¼cklich zum lagerplatz zurÃ¼ck.</p>"}}}'),
        ('5bbb40c7bb0f', '1', 0, null, '2023-06-24 21:49:38', '2023-06-24 21:49:58', 'd62d16c6afb6', 'd62d16c6afb6', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 9}, {"slot": "2", "width": 3}]}'),
        ('f28ae87dfdcd', '1', 0, null, '2022-02-04 22:22:56', '2022-02-04 22:22:56', '475f7b34581a', '0c57930a0e67', 'cfccaecd4bad', 'storyboard', '{"sections": {"129c06d1-4b4d-49d2-a83f-507d89463ffc": {"column1": "00:20", "column3": "", "position": 3, "column2Html": "<p>Spielstart</p><p>Tassilo(Pilot) und Blinky(Eingeborener) verkleiden sich fÃ¼r spÃ¤ter.</p>"}, "14c147cf-f9af-41da-9f1e-d594fb848575": {"column1": "14:20", "column3": "", "position": 0, "column2Html": "<p>Bagheera und Maki werden Ã¼ber das bevorstehende Game aufgeklÃ¤rt. Sie mÃ¼ssen je eine kleine rolle Ã¼bernehmen. Beide mÃ¶chten von dieser Insel weg jedoch die andere Person bzw Gruppe nicht dabei haben.</p>"}, "4d769fe7-420a-40cd-a497-110f43edebea": {"column1": "00:00", "column3": "", "position": 1, "column2Html": "<p>Bagheera und Maki streiten im Aufenthaltszelt. Blinky bildet 2 Gruppen -&gt; Der GrÃ¶sse nach aufstellen und auf 2 nummerieren. </p><p>Blinky lÃ¤uft dann mit beiden Gruppen in den Wald</p>"}, "9271d5a0-ff4e-4f6f-a7d1-eab644eed6e7": {"column1": "01:50", "column3": "", "position": 6, "column2Html": "<p>ZurÃ¼cklaufen mit Tassilo. Eingeborene laufen zurÃ¼ck in den Wald.</p>"}, "b7cc715e-75ff-41c3-b9e1-adf3692da030": {"column1": "01:40", "column3": "", "position": 5, "column2Html": "<p>Spielende</p><p>Alle TNs besammeln sich. Sie schauen sich zusammen mit den Eingeborenen die Notsignale an. Die Eingeborenen sind beidruckt und helfen beim aufrÃ¤umen dÃ¼rfen dafÃ¼r aber die LeuchtstÃ¤be behalten. Der Pilot ist abgehauen -&gt; wieder als Leiter anwesend</p>"}, "b9bfc7cd-4d5a-4287-b6fe-32e3497d0d1b": {"column1": "00:30", "column3": "", "position": 4, "column2Html": "<p>Pilot (Tassilo)und eingeborene(alle Leiter) klauen StÃ¤bchen min. 1 Eingeborener ist hierbei beim neutralen Posten (erste paar Minuten Blinky).</p>"}, "ff5a0167-2060-42e9-810a-c79409b1ffb6": {"column1": "00:10", "column3": "", "position": 2, "column2Html": "<p>SPIELERKLÃRUNG (Blinky):</p><p>Es muss ein Notsignal gesendet werden. Beide Parteien haben dafÃ¼r je ein mit Absperrband abgesperrter Bereich im Wald (ca5x5m) mit je 10 LeuchtstÃ¤bchen. Beide Teams mÃ¼ssen versuchen ein LeuchtstÃ¤bchen vom Gegnerischen Bereich Klauen und zu ihrer eigenen Base bringen. Wer am meisten LeuchtstÃ¤bchen in seiner Base hat gewonnen und darf das Notsignal mit den StÃ¤bchen schreiben. Umeinander davon abzuhalten ihre LeuchtstÃ¤bchen zu klauen kann 3 mal auf den rÃ¼cken des Angreifers geklopft werden (wenn dieser ein LeuchstÃ¤bchen hat muss er dieses zurÃ¼ck gebeb). Der beklopfte muss dann auf der stelle 5 LiegestÃ¼tzen machen und zurÃ¼ck zur seiner Base gehen.</p><p>Die Eingeborenen klauen wÃ¤hrenddessen immer wieder LeuchtstÃ¤bchen weil sie diese fÃ¼r Magische StÃ¶ckchen halten.</p><p>Die LeuchtstÃ¤chen kÃ¶nnen dann wieder an einem neutralen Posten mit PfadiTech Wissen oder wenn 2 gegnerische TNs ein LeuchtstÃ¤bchen wollen mit einer Challenge zurÃ¼ckerobert werden.</p><p>SPIELABRUCH/ENDE:</p><p>3x pfeifen</p>"}}}'),
        ('ad3c129b71fd', '1', 0, null, '2022-02-04 22:18:46', '2022-02-04 22:18:46', '3a9614e39661', 'f63fb7a48ada', 'cfccaecd4bad', 'storyboard', '{"sections": {"cae7bc0e-945e-4796-8cec-5e9c248920fc": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Wir bessern aus was auszubessern ist</p>"}}}'),
        ('07577d953810', '1', 2, null, '2023-08-12 17:50:09', '2023-08-12 17:50:09', '0f50c26e1edb', '0f50c26e1edb', '3ef17bd1df72', 'materialnode', null),
        ('1a978f02a760', '1', 0, null, '2022-02-04 22:22:38', '2022-02-04 22:22:38', '2b3f79233387', '8d3112f28a34', 'cfccaecd4bad', 'storyboard', '{"sections": {"52742387-99a9-496a-9926-b6d3c13f513a": {"column1": "00.00", "column3": "", "position": 0, "column2Html": "<p>Jemand liest das Verspechen lauf vor.</p><p>Wir machen vier (Je nach anmeldungen fÃ¼nf) Gruppen.</p><p>in Posten besprechen sie mit einem Leiter ein StÃ¼ck des Versprechens.</p><p>bedeutung, umsetzung etc.</p><p>Posten 1: Ich verspreche/ mein MÃ¶glichstes zu tun</p><p>Posten 2: mich immer von neuem mit dem Pfadigesetz auseinanderzusetzen</p><p>Posten3:mich in jeder Gemeinschaft einzusetzen, in der ich lebe</p><p>Posten4:Nach Sinn und Ziel meines Lebens zu suchen</p><p>Posten5:zusammen mit euch allen</p>"}, "d33f6055-65e1-441b-8110-a3689e2b7fa5": {"column1": "1.00", "column3": "", "position": 1, "column2Html": "<p>Wir lernen das Pfadiversprechen mit dem \"Ich packe in meinen Rucksack\"-Spiel </p><p>Es beginnt jeamd und sagt \"Ich...\" und dann der reihe nach immer wieder holen was die andern zuvor gesagt haben und das nÃ¤chste Wort des Versprechens nennen.</p>"}}}'),
        ('d2187a3531af', '1', 0, null, '2022-02-04 19:52:33', '2022-02-04 19:52:33', 'ca9582689c1e', 'baeb0218568b', 'cfccaecd4bad', 'storyboard', '{"sections": {"2528747e-cf8b-48e2-92c9-76ebad4d9051": {"column1": "0''", "column3": "", "position": 0, "column2Html": "<p>KopfhÃ¶rer holen und looos</p>"}, "f0a54d25-e7b8-413e-9264-de10cc62c893": {"column1": "5''", "column3": "", "position": 1, "column2Html": "<p>Chanel 3 ist Russendisko</p><p>Chanel 1 ist nur Harry Potter Musik</p>"}}}'),
