        ('a54e27df1390', '1', 0, null, '2023-06-24 21:36:27', '2023-06-24 21:36:45', 'fb21b1c912fd', 'fb21b1c912fd', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('a6912f41f6c0', '1', 1, null, '2022-02-04 19:34:29', '2023-06-24 21:46:20', 'ff2ed0cab03e', 'ff2ed0cab03e', 'cfccaecd4bad', 'storyboard', '{"sections": {"407183cc-6c55-410d-9dbe-b950aa15188a": {"column1": "00:20", "column3": "selbstÃ¤ndig", "position": 2, "column2Html": "<p>Einteilung in schnelle und langsame Gruppe</p>"}, "586b35d3-a01d-410d-b7c1-d96d7bd341b2": {"column1": "00:00", "column3": "Castor", "position": 0, "column2Html": "<p>Einreihen der Velos &amp; Luftkontrolle</p>"}, "6f01d9e4-52fa-4081-b3c4-5f847c138990": {"column1": "00:30", "column3": "Castor &amp; Taifun", "position": 3, "column2Html": "<p>Abfahrt</p><p>Trinkpausen sind in der MZB vermerkt</p>"}, "763e4168-7b23-4fcb-8f0c-f38e93ba9163": {"column1": "00:10", "column3": "Farfalla", "position": 1, "column2Html": "<p>BegrÃ¼ssung &amp; Einsammeln von NFBs</p><p>Einleitung RF</p>"}}}'),
        ('77d0cd65577d', '1', 0, null, '2023-06-24 21:50:51', '2023-06-24 21:51:08', 'c7a28bcfd35f', 'c7a28bcfd35f', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('3a94193d3f6e', '1', 0, null, '2022-02-04 22:23:30', '2022-02-04 22:23:30', '3ddaa17f2649', '706d570b83cc', 'cfccaecd4bad', 'storyboard', '{"sections": {"e4b7599b-abab-4c70-8bb9-df4202f2b683": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Nach dem Zvieri Sagen wir den Kindern, dass es heute Abend ein Bi-Pi Feuer geben wird. Wir erklÃ¤ren, was das Bi-Pi Feuer ist. FÃ¼r das Bi-Pi Feuer mÃ¼ssen natÃ¼rlich vorbereitungen getroffen:</p><p>Zum einen muss jeder etwas gutes, etwas schlechtes (zur Pfadi) und einen Wunsch sowie ein Danke oder einen GlÃ¼ckwunsch aufschreiben (alles Anonym)</p><p>Ausserdem werden auch zwei freiwillige das Feuer nach Anleitung vorbereiten.</p><p>Das Bi-Pi Feuer ist eine Tradition die die Pfadi schon seit ewigkeiten durchfÃ¼hrt beim Bi-Pi Feuer wird der Letzte Brief von Bi-Pi vorgelesen und der Rest ist relativ Frei. Dennoch gibt es viele Regeln die eingehalten werden mÃ¼ssen.</p><p>-Es besteht aus einem Inneren und einem ausseren Steinkreis</p><p>-Die untersten zwei HÃ¶lzer sind nach der Nord-SÃ¼dachse ausgerichtet</p><p>-Das Feuer darf nur mit einer Fackel oder einer glÃ¼henden Kohle angezÃ¼ndet werden</p><p>-Am Anfang wird ein FeuerwÃ¤chter bestimmt der das Feuer entfacht</p><p>-Nur der FeuerwÃ¤chter darf in den 2. Steinkreis hinein und auch nur wenn er einen Stein entfernt</p><p>-Die Kohle wird direkt nach dem AnzÃ¼nden in das Feuer gelegt</p><p>-Das Feuer muss ausbrennen und darf nicht ausgelÃ¶scht werden</p><p>-Wenn die Glut ausgekÃ¼hlt ist bekommen alle anwesenden ein bisschen Kohle die sie dann im nÃ¤chsten Bi-Pi Feuer wieder verwendet werden kÃ¶nnen. So brennt das Feuer immer weiter</p>"}}}'),
        ('41463d5e6898', '1', 0, null, '2022-02-04 21:31:04', '2022-02-04 21:31:04', '3edf02e5fd3d', '51a9f1de497a', 'cfccaecd4bad', 'storyboard', '{"sections": {"3c1df90a-20e9-48ba-a1ca-6480ea357dd9": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Titel/Thema:</p><p>Blutiger Baron - Wut</p><p>Zielgruppe:</p><p>Pfadistufenkinder 11-14Jahre</p><p>LeiterIn:</p><p>Castor, Salamander</p><p>Zeit:</p><p>30 min. (07.07.201522:30 - 23:00)</p><p>Ort/ GelÃ¤nde:</p><p>Spielwiese</p><p>Ziele:</p><p>Die TN erweitern ihren Handlungsspielraum im Umgang mit Wut.</p>"}, "99a11f92-9b90-492c-96a9-c6381db0d2a6": {"column1": "5i", "column3": "", "position": 3, "column2Html": "<p>Abschluss</p><p>Der blutige Baron ist sehr zufrieden mit unseren Tns. Da er der Hausgeist von Slytherin ist und wir wissen, dass das Haussymbol der Slytherins eine Schlange ist, machen wir zum Abschluss einen âDer Schlange ihre Tanzâ.</p>"}, "cb45923e-bb45-45ea-b979-00b7a2646b0d": {"column1": "20''", "column3": "", "position": 2, "column2Html": "<p>Hauptteil:</p><p>Die TN hocken in den HÃ¤user (4 Gruppen) zusammen und machen ein TheÃ¤terli zum Thema âWUTâ. Davon machen sie eine schlechte und eine gute Variante.</p><p>Oberbegriffe â Ideen zu den TheÃ¤terli</p><p>-Schule</p><p>-Pfadi</p><p>-Eltern</p><p>-Ãffentlichkeit</p><p>â Schlange stehen</p><p>5'' Vorbereitungszeit</p><p>Danach AuffÃ¼hrung der TheÃ¤terli. Nach jedem Theater kurze Diskussion angeregt durch den Baron.</p><p>5'' Um uns im Ruhigbleiben zu Ã¼ben schlÃ¤gt der Baron einen magischen Augenkampf vor.</p><p>Immer 2 zusammen, man muss einander in die Augen schauen und dabei mÃ¶glichst ruhig bleiben.</p>"}, "e8567d7c-a5df-42bd-a04b-3b5e6f17eb8b": {"column1": "5''", "column3": "Salamander (blutiger Baron)", "position": 1, "column2Html": "<p>Einstieg:</p><p>Blutiger Baron stÃ¶sst zu uns und erklÃ¤rt uns seine missliche Lage.</p><p>Er zeigt uns vÃ¶llig demÃ¼tig seine Ketten.</p><p>Ketten &amp; Kugeln (vom Leiterfest)</p>"}}}'),
        ('8fc6eca9bc8a', '1', 0, null, '2022-02-04 22:27:57', '2022-02-04 22:27:57', '193c3491fa23', '604b01a8ece1', 'cfccaecd4bad', 'storyboard', '{"sections": {"58ee91ff-5393-4e4d-a7f8-c3a55008f11f": {"column1": "", "column3": "", "position": 1, "column2Html": "<p>14:44 BUS 520 15613 Richtung ZÃ¼rich Flughafen, Bahnhof /nach ZÃ¼rich Flughafen, Bahnhof /Ankunft 14:55</p><p>15:01 Zug S 16 19657 Richtung Herrliberg-Feldmeilen / nach ZÃ¼rich Oerlikon, Gleis 6 /Ankunft 15:05</p>"}, "5b6c91db-3d93-4b0d-ba39-16a729c9a886": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Wir laufen 1420 los</p>"}}}'),
        ('8a417fb40c7f', '1', 0, null, '2023-08-12 17:41:55', '2023-08-12 17:41:55', 'd7c126cfce5e', 'd7c126cfce5e', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('e3a4242a7d93', '1', 0, null, '2022-02-04 22:18:02', '2022-02-04 22:18:02', 'aff5fa86266e', 'fbc47b8cf426', 'cfccaecd4bad', 'storyboard', '{"sections": {"4e375ecc-ccef-4799-ad5f-fb9d424e2e64": {"column1": "0025", "column3": "", "position": 1, "column2Html": "<p>Als Hauptteil gehen wir in der nÃ¤heren umgebung Joggen. Die Leitperson gibt immer wieder Kommandos vor bei welchen alle die vorgegebene Ã¼bung machen mÃ¼ssen. z.B. bei 1 mÃ¼ssen alle springen.</p>"}, "8fafcb32-385a-40eb-979b-f61f3b1fa584": {"column1": "0010", "column3": "", "position": 0, "column2Html": "<p>Zum einwÃ¤rmen machen wir ein Pferderennen. Dabei klatschen sich alle mit den HÃ¤nden auf die Oberschenkel um das Hufgetrappel zu simulieren. Der Spielleiter gibt dann kommandos welche dann von allen durchgefÃ¼hrt werden mÃ¼ssen wenn jemand ein Kommando verpasst oder ein Kommado falsch macht muss 3 LiegestÃ¼tze machen. z.B. bei der Linkskurve lehnen alle nach links</p>"}, "c63cd87c-d985-4128-a085-3fb066ae5d53": {"column1": "0030", "column3": "", "position": 2, "column2Html": "<p>Zum Abschluss spielen wir noch ein Peng. Dabei wird zuerst ein Thema definiert z. B. Produkte aus der Migros. Das Ziel des Spiels ist es, dass man bis zum Schluss nicht ausgeschieden wird. Dann stellen sich immer zwei Personen RÃ¼cken an RÃ¼cken und gehen los. Dann sagt der Spielleiter einen Buchstaben und die Kinder mÃ¼ssen sich umdrehen und so schnell wie mÃ¶glich ein Migros Produkt sagen, dass mit diesem Buchstaben anfÃ¤ngt. Wenn man verliert wird man ausgeschieden.</p>"}}}'),
        ('350b44de53b5', '2', 0, null, '2022-02-04 21:42:21', '2022-02-04 21:42:21', '8fa1c8e597c3', '0a23aa100e1b', '4f0c657fecef', 'singletext', '{"html": ""}'),
        ('ea49fbe4a79b', '1', 0, null, '2022-02-04 21:25:26', '2022-02-04 21:25:26', '645000130f8c', '645000130f8c', 'cfccaecd4bad', 'storyboard', '{"sections": {"907e4d4f-5d07-470f-a70d-a3aa374af82a": {"column1": "''00", "column3": "", "position": 0, "column2Html": "<p>Ãbermittlung: Skippy, Castor</p><p>Kochen: Daniel DÃ¼sentrieb,</p><p>TÃ¤tschmeischter: Salamander</p><p>Sport: Adler &amp; Taifun &amp; Pandora</p><p>Pionier: Biber</p><p>Den TN werden zu Beginn die einzelnen Spez-Exer vorgestellt und sie kÃ¶nnen sich dann entscheiden, welchen sie machen mÃ¶chten. Wenn sich fÃ¼r ein Spez-Exer nur ein TN begeistert, wird dieser leider nicht durchgefÃ¼hrt. Die Leiter die keinen fixen Spez-Exer haben, helfen den anderen wo nÃ¶tig.</p>"}}}'),
