        ('54f16315d853', '3', 0, null, '2022-02-04 21:42:31', '2023-06-24 21:35:35', '8fa1c8e597c3', '1a74a1186c21', '1a0f84e322c8', 'multiselect', '{"options": {"security": {"checked": false}, "outdoorTechnique": {"checked": false}, "pioneeringTechnique": {"checked": false}, "natureAndEnvironment": {"checked": false}, "campsiteAndSurroundings": {"checked": false}, "preventionAndIntegration": {"checked": false}}}'),
        ('0a23aa100e1b', '1', 2, null, '2022-02-04 21:42:07', '2022-02-04 21:42:10', '8fa1c8e597c3', '8fa1c8e597c3', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 9}, {"slot": "2", "width": 3}]}'),
        ('068370456651', '1', 1, null, '2022-02-04 19:38:15', '2023-06-24 21:51:11', 'c7a28bcfd35f', 'c7a28bcfd35f', 'cfccaecd4bad', 'storyboard', '{"sections": {"2d22bc52-506c-4974-a969-62e7761b913d": {"column1": "00:40", "column3": "Pandora", "position": 4, "column2Html": "<p>Als nÃ¤chstes Spielen wir ein Seilziehen in den Ãmtli Gruppen.</p><p>Regeln vorher erklÃ¤ren: Niemand darf abrupt loslassen, genÃ¼gend Abstand zu BÃ¤umen, wenn man merkt, dass man nicht mehr kann sagt man es und lÃ¤sst nicht einfach los, Seil nicht um Handgelenk wickeln, nur halten ...</p>"}, "3855acd7-c71f-40dc-b81d-722f66c893a9": {"column1": "00:55", "column3": "Pandora", "position": 5, "column2Html": "<p>Zum Schluss machen wir ein Gordischer Knoten.</p>"}, "3e147286-a967-4d4a-bc9e-c40eba38ac54": {"column1": "00:10", "column3": "Pandora", "position": 1, "column2Html": "<p>Wir spielen ein British Bulldog.</p>"}, "8a5a895b-28d2-4bff-9321-5a3c20a30a44": {"column1": "00:30", "column3": "Pandora", "position": 3, "column2Html": "<p>Jeder nimmt sich ein TN von der anderen Abteilung. Danach spielen wir ein Blinzlerspiel.</p>"}, "8bf60ad5-9979-4835-b0fc-4e935297ab51": {"column1": "00:00", "column3": "Pandora", "position": 0, "column2Html": "<p>Besammlung auf dem Lagerplatz. Wir spielen verschiedene Kurzspiele.</p><p>Zum AufwÃ¤rmen spielen wir ein kurzes ZitiglÃ¤sÃ¤</p>"}, "fa49a1d2-613e-4cfb-94ce-53aa8783b301": {"column1": "00:20", "column3": "Pandora", "position": 2, "column2Html": "<p>Als nÃ¤chstes spielen wir ein Stock im Kreis.</p>"}}}'),
        ('7a2282e04097', '1', 0, null, '2022-02-04 22:06:20', '2023-06-24 21:37:54', '985356416a4b', 'a9e364f1e633', '318e064ea0c9', 'singletext', '{"html": "<p>Unsere Flugtickets sind davongeflogen (Wind) wir mÃ¼ssen sie wieder einsammeln</p>"}'),
        ('9a4845d2e259', '1', 1, null, '2022-02-04 22:06:20', '2023-06-24 21:37:35', '985356416a4b', '985356416a4b', 'cfccaecd4bad', 'storyboard', '{"sections": {"219983be-c40c-464d-8c26-b65524952a3f": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Wir besammeln uns beim Bahnhof Oerlikon und gehen nach der Besammlung zum MFO-Park.</p><p>Die Leiter haben leider die Flugtickets verloren. Die Einzelteile sind nun in ganz Oerlikon verteilt. Wir mÃ¼ssen sie nun wieder einsammeln.</p>"}, "27827c38-1ed2-4055-8ae6-bdeed66e420c": {"column1": "", "column3": "", "position": 2, "column2Html": "<p>Jede Gruppe bekommt eine Karte und es findet ein Stern-OL statt.</p><p>Bei jedem Posten finden sie einen Teil des Tickets</p><p>Jede Gruppe muss bei jedem Posten vorbei.</p>"}, "52850311-1263-4e93-b361-014f8e6595ec": {"column1": "", "column3": "", "position": 1, "column2Html": "<p>Um die Gruppen einzuteilen machen wir ein AtÃ¶mle: Es rennen alle durcheinander und eine Leitperson sagt eine Zahl. Nun mÃ¼ssen die TN''s sich in Gruppen dieser Anzahl stellen. Alle die nicht in einer Gruppe (einem Atom) sind scheiden aus und werden in Gruppen eingeteilt</p>"}, "59519592-a1ed-4117-86e1-806cd40adbe9": {"column1": "", "column3": "", "position": 3, "column2Html": "<p>Alle Gruppen waren bei allen Posten. Nun mÃ¼ssen sie die Tickets zusammensetzten</p>"}}}'),
        ('a9e364f1e633', '1', 0, null, '2023-06-24 21:37:37', '2023-06-24 21:37:55', '985356416a4b', '985356416a4b', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('381c06d8ac17', '2', 0, null, '2022-02-04 22:10:52', '2023-06-24 21:38:55', '78c9196140b7', '41f475b8cb74', '44dcc7493c65', 'singletext', '{"html": ""}'),
        ('80352238933c', '1', 0, null, '2022-02-04 22:10:52', '2023-06-24 21:38:58', '78c9196140b7', '41f475b8cb74', '318e064ea0c9', 'singletext', '{"html": ""}'),
        ('07c09b2470ac', '1', 0, null, '2022-02-04 22:10:52', '2022-02-04 22:10:52', '78c9196140b7', '16c1b1868c60', '3ef17bd1df72', 'materialnode', null),
        ('16c1b1868c60', '1', 2, null, '2022-02-04 22:10:52', '2022-02-04 22:10:52', '78c9196140b7', '78c9196140b7', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 9}, {"slot": "2", "width": 3}]}'),
        ('e9d479b98d18', '1', 1, null, '2022-02-04 22:10:52', '2023-06-24 21:39:03', '78c9196140b7', '78c9196140b7', 'cfccaecd4bad', 'storyboard', '{"sections": {"44e06a87-519e-47df-81e7-5e18eebf2d92": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Wir treffen uns um 18:00 am Bahnhof Oerlikon.</p>"}, "67fb26c3-3dbb-44f3-9341-f5303debb367": {"column1": "", "column3": "", "position": 3, "column2Html": "<p>Wir laufen zum Lagerplatz</p>"}, "a29e95f2-1d57-43f2-812d-a6fcabaed1e9": {"column1": "", "column3": "", "position": 1, "column2Html": "<p>Wir nahmen den 10er in ZÃ¼rich Bhf Oerlikon Ost richtung Flughafen um 18:31 ankunft 1844 in zÃ¼rich Flughafen</p>"}, "a9215894-d25e-4e54-b932-71f78f2f2e90": {"column1": "", "column3": "", "position": 2, "column2Html": "<p>18:49 BUS 524 8063 Richtung Oberembrach, Dorf bis nach Lufigen Augwil. Ankunft 18:58</p>"}}}'),
        ('41f475b8cb74', '1', 0, null, '2023-06-24 21:38:33', '2023-06-24 21:39:05', '78c9196140b7', '78c9196140b7', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('73ce151126d3', '2', 0, null, '2022-02-04 22:11:12', '2023-06-24 21:39:50', 'c2eae59077c5', '5206ed019433', '44dcc7493c65', 'singletext', '{"html": ""}'),
        ('5206ed019433', '1', 0, null, '2023-06-24 21:39:20', '2023-06-24 21:39:57', 'c2eae59077c5', 'c2eae59077c5', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 4}, {"slot": "2", "width": 5}, {"slot": "3", "width": 3}]}'),
        ('00c6fe37b137', '1', 1, null, '2022-02-04 22:11:12', '2023-06-24 21:40:06', 'c2eae59077c5', 'c2eae59077c5', 'cfccaecd4bad', 'storyboard', '{"sections": {"2079d41d-9398-484a-b2f0-e5c2cd2c5d6a": {"column1": "", "column3": "", "position": 0, "column2Html": "<p>Wir machen vier Gruppen.</p><p>Gruppe1 KÃ¼che-Aufenthalt-Essenszelt</p><p>Gruppe2 Schlafzelter</p><p>Gruppe3 KÃ¼cheninneneinrichtung</p><p>Gruppe4 Latrine</p>"}, "c1932814-476e-4ca1-bb7b-965bead38ef2": {"column1": "", "column3": "", "position": 1, "column2Html": "<p>Alle Gruppe Ã¼berlegen wo sie Ihre Zelter / Bauten Aufstellen mÃ¶chten und zeichnen ein Plan-Krokki auf ein Packpapier. FÃ¼r Ausbesserungen und Fragen steht Tassilo bereit.</p>"}, "d82b9038-2f38-44d4-9238-83dd6bc68aa5": {"column1": "", "column3": "", "position": 2, "column2Html": "<p>Gruppe2 beginnt mit dem Aufbau der Schlafzelter</p><p>Dazu zeigt der Gruppenleiter zuerst vor, wie man in einer 3er Gruppe einen Spatz aufstellt. Dann werden 3 er Gruppen gebildet und die TN wiederholen das gezeigte mit dem Aufbau von weiteren Spatzen. </p><p>Gruppe1, Gruppe3 und Gruppe4 Der Gruppenleiter zeigt vor, wie gewisse TÃ¤tigkeiten (Seil spannen, Blachen mit Seil spannen, Blachen knÃ¶pfen) richtig gemacht werden. Dann wiederholen die TN das gezeigte an den weiteren Stellen, wo das gemacht werden muss.</p>"}, "fd7ea45c-c418-47d0-8989-9a5d0384e607": {"column1": "", "column3": "", "position": 3, "column2Html": "<p>Alle Zelter sind Aufgestellt und besprechen wo es Schwierigkeiten gegeben hat und wie man es besser lÃ¶sen kÃ¶nnte.</p>"}}}'),
        ('597e98ec6e64', '1', 0, null, '2023-06-24 21:40:47', '2023-06-24 21:41:02', '69fa08a77f38', '69fa08a77f38', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('9d6f2f561e47', null, 0, null, '2023-08-12 17:51:26', '2023-08-12 17:51:26', '9d6f2f561e47', null, 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 12}]}'),
        ('0060dca7b27e', '1', 1, null, '2023-08-12 17:51:36', '2023-08-12 17:51:36', '9d6f2f561e47', '9d6f2f561e47', '318e064ea0c9', 'singletext', '{"html": ""}'),
        ('78e81d1fbf0d', '1', 1, null, '2022-02-04 22:16:56', '2023-06-24 21:40:44', '69fa08a77f38', '69fa08a77f38', 'cfccaecd4bad', 'storyboard', '{"sections": {"173ba129-de42-44f3-8260-9231f3ae52ad": {"column1": "0:30", "column3": "Snoopy, Idefix", "position": 2, "column2Html": "<p>Da wir uns auf einem Langstreckenflug befinden, kÃ¶nnen die mÃ¼den Passagiere sich auf die SchlafplÃ¤tze begeben (ZÃ¤hneputzen und in die Zelter gehen). Der Flug beginnt.</p>"}, "4be9fd34-0b96-4156-8401-463154641136": {"column1": "0:00", "column3": "Snoopy, Idefix", "position": 0, "column2Html": "<p>Um unsere Reise sicher zu starten mÃ¼ssen wir alle durch die Sicherheitskontrolle: Holz Bogen mit Lichter etc wie am Flughafen, Sicherheitskontrolle bei Security (abtasten). Bei einigen TN''s piepst es und wir schmuggeln ihnen unerlaubte GegenstÃ¤nde wie Wasserpistolen, Trinkflaschen etc. unter. Die TN''s mit unerlaubten GegenstÃ¤nde mÃ¼ssen als Strafe 5 mal um die Zelter rennen und 10 LiegestÃ¼tzen machen. Sobald alle durch die Kontrolle sind kÃ¶nnen wir ins Flugzeug.</p>"}, "e8747710-b5ba-44a5-8b13-4ee1f8acf36e": {"column1": "0:15", "column3": "Snoopy, Idefix", "position": 1, "column2Html": "<p>Um zum Flugzeug zu kommen laufen wir mit einem Flughafenmensch  entlang der Flugpiste (mit Kerzen oder LeuchtstÃ¤bli abgesteckt). Wir setzen uns alle im Flugzeug (Pflanzentunnel Familie Amacher, alternative: jedes Kind liegt schon an seinen Schlafplatz symbolisch fÃ¼r Sitzplatz) in Reihen hin (wie im Flugi). Die Flugbegleiterin / Der Flugbegleiter erklÃ¤rt uns die Sicherheitsregeln und der Pilot wÃ¼nscht uns einen guten Flug.</p>"}}}'),
        ('7ce34913a812', '1', 0, null, '2023-06-24 21:48:20', '2023-06-24 21:48:57', 'a71f929dd156', 'a71f929dd156', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('b0c58f2d5c48', '1', 0, null, '2023-06-24 21:41:22', '2023-06-24 21:41:39', '5015df0b6259', '5015df0b6259', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('f5b193a90c4f', '1', 1, null, '2022-02-04 22:17:30', '2023-06-24 21:41:43', '5015df0b6259', '5015df0b6259', 'cfccaecd4bad', 'storyboard', '{"sections": {"1654a176-901e-46ba-bafd-cd3da86a3f02": {"column1": "00:15", "column3": "", "position": 1, "column2Html": "<p>Alle Kinder sind auf ihren SitzplÃ¤tzen angeschnallt, dann beginnt eines der Triebwerke zu brennen und die Sauerstoffmasken kommen aus der Decke, sie mÃ¼ssen diese alle Anziehen.</p>"}, "740d442c-5681-4fd2-8c92-82a64abe6d28": {"column1": "00:25", "column3": "", "position": 3, "column2Html": "<p>Wir regen uns langsam am Boden, um uns herum das zerstÃ¶rte und brennende Flugzeug. Einem Leiter wurde der Arm aufgeschlitzt (Blinky) und er blutet stark, um erste Hilfe zu leisten suchen wir die Apotheke im Flugzeug. Wir versuchen, RettungskrÃ¤fte zu kontaktieren, haben aber kein Netz. Nachdem wir festgestellt haben, dass alle da sind und der verletzte Leiter versorgt ist, teilen wir Wachen  ein (nur die Leiter, die wachen nicht wirklich sondern gehen dann schlafen) und schicken die TN wieder ins Bett.</p>"}, "7a217759-3847-4ede-9daf-f8a8db4b2f8d": {"column1": "00:20", "column3": "", "position": 2, "column2Html": "<p>Ein Triebwerk explodiert und kurz darauf schlagen wir auf, die Leiter stossen alle Kinder durcheinander und werfen die \"StÃ¼hle\" um, um den Absturz zu simulieren.</p>"}, "f065e540-3d15-4542-bc08-2541d3d3db1e": {"column1": "00:00", "column3": "", "position": 0, "column2Html": "<p>Die TN werden von lautem Sirenengeheul geweckt. Ein Triebwerk des Flugzeugs, in dem wir fliegen, ist ausgefalllen. Alle mÃ¼ssen sofort auf ihre SitzplÃ¤tze und die Gurte anschnallen.</p>"}}}'),
        ('dbe26ada5622', '1', 0, null, '2023-06-24 21:51:26', '2023-06-24 21:51:42', '83b61af97910', '83b61af97910', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('8b967bf8d778', '2', 0, null, '2022-02-04 19:34:29', '2023-06-24 21:46:13', 'ff2ed0cab03e', 'f7edad8b4889', '44dcc7493c65', 'singletext', '{"html": "<p>Velomechs auf der <strong>Strecke</strong>:</p><ul><li><p>Velos - Motos Ryser, Musterdorf, 077 123 45 67</p></li><li><p>Radprofi Weibel, Ennetda, 021 123 45 67</p></li></ul>"}'),
        ('f7edad8b4889', '1', 0, null, '2023-06-24 21:46:03', '2023-06-24 21:46:18', 'ff2ed0cab03e', 'ff2ed0cab03e', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('fec746d4520a', '1', 2, null, '2022-02-04 19:34:29', '2022-02-04 19:34:29', 'ff2ed0cab03e', 'ff2ed0cab03e', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 9}, {"slot": "2", "width": 3}]}'),
        ('b4c4448b9039', '1', 0, null, '2023-06-24 21:47:50', '2023-06-24 21:48:02', 'a2505e2c8aca', 'a2505e2c8aca', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 5}, {"slot": "2", "width": 7}]}'),
        ('8245d44306f4', '1', 1, null, '2022-02-04 19:36:21', '2023-06-24 21:48:51', 'a71f929dd156', 'a71f929dd156', 'cfccaecd4bad', 'storyboard', '{"sections": {"0d01135d-67c2-4473-8ad7-012a54f86b11": {"column1": "''200 - ''240", "column3": "", "position": 4, "column2Html": "<p>Zelte wahrscheinlich fertig, dann:</p><p>J&amp;S Material holen (mit VeloanhÃ¤nger)</p><p>Wasserschlauch von Waldran bis Lagerplatz anschliessen</p>"}, "75b3d84e-744a-46cc-b97d-535e4b68dfa2": {"column1": "''200 - ''210", "column3": "", "position": 3, "column2Html": "<p>gemeinsame Trinkpause und kurzes Spiel (Ritter auf Ritter ab)</p>"}, "834709ae-7423-4c1a-8c48-1d7240a7d08a": {"column1": "''120 - ''140", "column3": "", "position": 1, "column2Html": "<p>Z''Vieri</p>"}, "8c6911b3-8da5-43bf-aaa5-2d0aa0035533": {"column1": "''00 - ''120", "column3": "", "position": 0, "column2Html": "<p>Aufteilung in Gruppen:</p><p>Gruppe 1 (5TN + 1 Leiter): Zelte aufstellen</p><p>Gruppe 2 (3TN + 1 Leiter): Latrine buddeln</p><p>Gruppe 3 (7TN + 1 Leiter): Aufenthaltszelt (Blachen knÃ¼pfen und hochziehen)</p><p>Gruppe 4 (5TN + 1 Leiter): KÃ¼chenzelt, Kochstelle, Sickergrube</p><p>(ab und zu Trinkpausen machen)</p>"}, "c92d69d8-7841-40d6-804b-5cf7b18d5cfd": {"column1": "''140-''200", "column3": "", "position": 2, "column2Html": "<p>weiter aufbauen (je nach Gruppenstimmung Gruppen wechseln)</p>"}}}'),
        ('04a66054f840', '1', 0, null, '2023-06-24 21:51:58', '2023-06-24 21:52:34', '02823e618716', '02823e618716', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 4}, {"slot": "2", "width": 5}, {"slot": "3", "width": 3}]}'),
        ('b570ee7e3999', '1', 2, null, '2022-02-04 19:39:53', '2022-02-04 19:39:53', '02823e618716', '02823e618716', 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 9}, {"slot": "2", "width": 3}]}'),
        ('c991163f4af4', '1', 0, null, '2023-08-12 17:51:33', '2023-08-12 17:51:33', '9d6f2f561e47', '9d6f2f561e47', 'cfccaecd4bad', 'storyboard', '{"sections": {"62125270-d4c4-47a9-9bb9-615225c1f4db": {"column1": "", "column3": "", "position": 0, "column2Html": ""}}}'),
        ('23a037c64e04', null, 0, null, '2023-08-12 17:52:11', '2023-08-12 17:52:11', '23a037c64e04', null, 'f17470519474', 'columnlayout', '{"columns": [{"slot": "1", "width": 12}]}'),
        ('634ca047f841', '1', 0, null, '2023-08-12 17:52:17', '2023-08-12 17:52:17', '23a037c64e04', '23a037c64e04', 'cfccaecd4bad', 'storyboard', '{"sections": {"7ad0a22b-5078-4993-a2a1-2135b8aeec94": {"column1": "", "column3": "", "position": 0, "column2Html": ""}}}'),
        ('65503fbfbea0', '1', 1, null, '2023-08-12 17:52:23', '2023-08-12 17:52:23', '23a037c64e04', '23a037c64e04', '318e064ea0c9', 'singletext', '{"html": ""}'),
        ('0810d1a172db', '1', 1, null, '2022-02-04 19:39:53', '2023-06-24 21:52:39', '02823e618716', '02823e618716', 'cfccaecd4bad', 'storyboard', '{"sections": {"42ed6f1e-7956-4fd6-8725-f55eded0bbbe": {"column1": "''70-''90", "column3": "Farfalla", "position": 3, "column2Html": "<p>Die Regeln werden zusammengetragen, ergÃ¤nzt was sonst noch auf den Lagerpakt gehÃ¶rt (TN wird erklÃ¤rt, dass diese Regeln sicherheitsrelevant sind und daher nicht zwingend aus dem Pfadigesetz abgeleitet werden kÃ¶nnen) und dann mit allen TN durchgegeangen. Am Schluss unterschreiben alle TN den Lagerpakt.</p>"}, "4f8b6859-33e8-43d3-b44e-7f271931d5c4": {"column1": "''10", "column3": "", "position": 1, "column2Html": "<p>Der Postenlauf beginnt, es gibt vier Posten Ã  zwei Pfadigesetze, jeder Posten ist von mind. einem Leiter besetzt.</p><p>Die TN haben 10'' Zeit pro Posten und dann 5'' zum Wechseln.</p><p>Der gesamte Postenlauf dauert also 60 Minuten. es pfeift wenn gewechselt wird.</p><p>Die letzte Gruppe bei einem Posten hilft dann dem Leiter mit allem Material zurÃ¼ck zum Aufenthaltszelt- / platz zu kommen.</p><p>Beim Posten bespricht die Gruppe zuerst kurz was diese Pfadigesetze genau bedeuten und Ã¼berlegt sich dann Reglen dazu, die im Lager nÃ¼tzlich sein kÃ¶nnten. Der Postenbetreuer kann Inputs geben, falls die TN keine Idee mehr haben und schreibt die Regeln der TN auf. Am Ende des Postenlaufs streicht er dann alle doppelten Regeln, sodass nur noch die Ã¼brigbleiben, die dann auf den Lagerpakt kommen.</p>"}, "67528e31-3b53-47a0-acd8-424047b277c5": {"column1": "''00", "column3": "Farfalla", "position": 0, "column2Html": "<p>ErklÃ¤rung RF und Postenlauf, die TN absolvieren den Postenlauf in ihren HÃ¤user-Gruppen (So lernen sie sich gleich besser kennen)</p>"}, "79ceddd3-d68b-4d04-8c14-982f38e603bc": {"column1": "''10 - ''70", "column3": "Postenbetreuer", "position": 2, "column2Html": "<p>Posten 1: Offen und ehrlich sein und Freude suchen und weitergeben</p><p>(mÃ¶gliche Regeln: Sagen wenn etwas kaputt geht, zu seinen Missgeschicken stehen etc.)</p><p>Posten 2: andere verstehen und achten und miteinander teilen</p><p>(MÃ¶gliche Regeln: kein Mobbing, einander zuhÃ¶ren, wenn Leiter sprechen ist es still...)</p><p>Posten 3: unsere Hilfe anbieten und uns entscheiden und Verantwortung tragen</p><p>(MÃ¶gliche Regeln: den JÃ¼ngeren helfen, sein Ãmtli sauber und korrekt erledigen etc,)</p><p>Psoten 4: Sorge tragen zur Natur und allem Leben und Schwierigkeiten mit Zuversicht begegnen</p><p>(MÃ¶gliche Regeln: Abfall in Abfallsack, wenn man ein Problem hat um Hilfe bitten, aber auch Verstand einsetzen ... )</p>"}}}'),
